import React from 'react';
import { Layout, Image, Typhgraphy } from "antd";
import Logo from "./images/logo.png";

const { Title } = Typography;
const { Header, Footer } = Layout;

const App = () => {
    return ( 
    <Layout>
        <header>
            <Image width="45" perview="false" src={Logo}></Image>
        </header>
    </Layout>
    )
}

export default App;
